import React, {Component} from "react";

export default class Languages extends Component{

    state = {languages: 
        [
            { name: "Javascript", voteCount: 0 },
            { name: "Python", voteCount: 0 },
            { name: "Go", voteCount: 0 },
            { name: "Java", voteCount: 0 },
            { name: "Typescript", voteCount: 0 },
            { name: "Ruby", voteCount: 0 },
            { name: "Elixir", voteCount: 0 }       

        ]}



    render(){

        return( 
        <div className="list-group">
                    <div className="list-group-item">
                            {this.state.languages.array.forEach(element => 
                            <div className="row">
                                <div className="col-md-8">{element.voteCount}</div>,
                                <div className="col-md-2">{element.name}</div>,
                                <div className="col-md-2"><button>vote</button></div>,
                            </div>
                            )}



                </div>
        </div>
        )







    }




}
